export default function CsvReader(){
    const csvFile = './data.csv';
    
    const submit = () => {
        const reader = new FileReader();
        reader.onload = function(e) {
            const text = e.target.result;
            console.log(text);
        }

        reader.readAsText(csvFile);
    }

    return(
        <div>
            {submit()}
            <p>Hello</p>
        </div>
    );

}
